import React, { Component } from 'react'
import Item from './Project/Item';

export default class Dashboard extends Component {
    render() {
        return (
            <div>
                <h1>This is a Component.</h1>
                <a href="ProjectForm.html" className="btn btn-lg btn-info">
                Create a Project
              </a>
              <br />
              <hr />
                <Item />
                <Item />
            </div>
        )
    }
}
